import React, { useRef } from 'react';
import Cookies from 'js-cookie';
import jwt from 'jwt-decode';
import Stack from '@mui/material/Stack';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import request from 'axios';

function SignIn() {
  const usernameInput = useRef(null);
  const passwordInput = useRef(null);
  const emailInput = useRef(null);
  const handleSubmitButton = async () => {
    const jwtToken = Cookies.get('token', {path: '/'});
    console.log('Jwt token is');
    console.log(JSON.stringify(jwtToken));
    const user = await jwt(jwtToken);
    console.log('Jwt token decoded is');
    console.log(user);
    const credentials = {
      username:usernameInput.current.value,
      password: passwordInput.current.value,
      email: emailInput.current.value,
    };
    // const res = await request.post("http://localhost:8080/signin", credentials, {
    //   withCredentials: true,
    // });
    // console.log(res)
  };

  return (
    <div className="SignIn">
      <Stack spacing={2}>
        <TextField type="text" label="Username" ref={usernameInput} />
        <TextField type="text" label="Password" ref={passwordInput} />
        <Button variant="contained" type="submit" onClick={handleSubmitButton}>Submit</Button>
      </Stack>
    </div>
  );
}

export default SignIn;
